import LoginPage from './LoginPage'
import App from './App'

export default function Authentication(){
    window.localStorage.setItem("isNotLoggedIn",true)
    if(window.localStorage.getItem("isNotLoggedIn")){
        alert("User is not logged in.")
        return(
            <LoginPage/>
        );
        }  
    else{
        alert("logged in")
        return(
            <App/>
            );
    }
}
